    <p>{`The Vector `}<inlineCode parentName="p">{`rename_fields`}</inlineCode>{` transform
accepts and outputs `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` events, allowing you to rename
one or more log fields.`}</p>
    {
      /*
