      <Field common={false} defaultValue={false} enumValues={null} examples={[false, true]} groups={[]} name={"drop_empty"} path={null} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "drop_empty"
        }}>{`drop_empty`}</h3>
        <p>{`If set to `}<inlineCode parentName="p">{`true`}</inlineCode>{`, after renaming fields, remove any parent objects of the old
field that are now empty.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[]} groups={[]} name={"fields"} path={null} relevantWhen={null} required={true} templateable={false} type={"table"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "fields"
        }}>{`fields`}</h3>
        <p>{`A table of old-key/new-key pairs representing the keys to be moved in the event.`}</p>
        <Fields filters={false} mdxType="Fields">
          <Field common={true} defaultValue={null} enumValues={null} examples={[{
            "old_field_name": "new_field_name"
