            <p>{`Old-key/New-key pair reprsenting the key to be moved.`}</p>
          </Field>
        </Fields>
      </Field>
    </Fields>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>
    <p>{`Given the following `}<inlineCode parentName="p">{`log`}</inlineCode>{` event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-js"
      }}>{`{
  // ...
  "old_field": "root_value",
  "old_nested": {
    "nested": "nested_value"
  }
  // ...
}
`}</code></pre>
    <p>{`And a Vector configuration like:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.my_transform]
  type = "rename_fields"
  inputs = [...]

  fields.old_field = "new_field"
  fields.old_nested.nested = "new_nested.nested",
`}</code></pre>
    <p>{`Will result in the following `}<inlineCode parentName="p">{`log`}</inlineCode>{` event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-js"
      }}>{`{
  // ...
  "new_field": "root_value",
  "new_nested": {
    "nested": "nested_value"
  }
  // ...
}
`}</code></pre>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`rename_fields`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "conflicts"
    }}>{`Conflicts`}</h3>
    <h4 {...{
      "id": "key-conflicts"
    }}>{`Key Conflicts`}</h4>
    <p>{`Keys specified in this transform will replace existing keys.`}</p>
    <Alert type="warning" mdxType="Alert">
      <p>{`Please note. Vector makes no guarantee on the order of execution. If two rename
operations must be performed in a specific order, it is recommended to split
them up across two separate rename transforms.`}</p>
    </Alert>
    <h4 {...{
      "id": "nested-key-conflicts"
    }}>{`Nested Key Conflicts`}</h4>
    <p>{`Keys are renamed in a deep fashion. They will not replace any ancestor
objects. For example, given the following `}<inlineCode parentName="p">{`log`}</inlineCode>{` event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-javascript"
      }}>{`{
  "root": "value2",
  "parent": {
    "child1": "value1"
  }
}
`}</code></pre>
    <p>{`And the following configuration:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml"
      }}>{`[transforms.rename_nested_field]
  type = "rename_fields"
  fields.root = "parent.child2"
`}</code></pre>
    <p>{`Will result in the following log event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-javascript"
      }}>{`{
  "parent": {
    "child1": "value1",
    "child2": "value2"
  }
}
`}</code></pre>
    <p>{`Notice that `}<inlineCode parentName="p">{`parent.child1`}</inlineCode>{` field was preserved.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    </MDXLayout>;
}

